import React from "react";
import "../css/fileServicesBlock.css";
function FileServicesBlock() {
  return (
    <section className="servicesBlock">
      <i class="fa-solid fa-syringe icon_absolute_one"></i>
      <i class="fa-solid fa-heart-pulse icon_absolute_two"></i>
      <h2 className="subTitle">Medical & General Care!</h2>
      <h3 className="mainTitle">Amazing Services</h3>
      <p className="mainText">
        Proactively revolutionize granular customer service after pandemic
        internal or <br /> "organic" sources istinctively impact proactive human
      </p>
      <div className="servicesSlider">
        <nav>
          <div className="slidePhoto"></div>
        </nav>
      </div>
    </section>
  );
}
export default FileServicesBlock;
